 import Result from "./result"
const Home = ()=>{
  let [img,Setimg] =useState("")

 function Input(e){
Setimg(e.target.value)
 }

  return(
      <> 
      <div className="main" style={{background}}>
      <input 
      type="text"
      value={img}
       placeholder="search Images"
        onChange={Input}
        className="rounded-pill"
        />
        <Result name={img}/>
      </div>


      </>
  )

}

export default Home;
